const fetch = require('node-fetch');
const d3 = require('d3');

// Function to parse HTML and extract links
async function fetchAndParse(url) {
  try {
    const response = await fetch(url);
    if (!response.ok) throw new Error(`Failed to fetch ${url}: ${response.statusText}`);
    const html = await response.text();

    const links = html.match(/<a\s+(?:[^>]*?\s+)?href="([^"]*)"/g)
      ?.map(link => link.match(/href="([^"]*)"/)?.[1])
      .filter(Boolean) || [];

    return { url, links };
  } catch (error) {
    console.error(`Error parsing ${url}: ${error.message}`);
    return { url, links: [], error: error.message };
  }
}

// Batch processing with prefetching
async function processBatchWithPrefetch(urls, batchSize) {
  const results = [];
  for (let i = 0; i < urls.length; i += batchSize) {
    const batch = urls.slice(i, i + batchSize);
    const prefetchPromises = batch.map(url => fetchAndParse(url));
    const settled = await Promise.allSettled(prefetchPromises);

    settled.forEach((result, index) => {
      if (result.status === 'fulfilled') {
        results.push(result.value);
      } else {
        console.error(`Error in batch ${i + index}: ${result.reason}`);
        results.push({ url: batch[index], links: [], error: result.reason });
      }
    });
  }
  return results;
}

