const axios = require('axios');
const cheerio = require('cheerio');
const { URL } = require('url');

class PageAnalysis {
  constructor(url) {
    this.url = url;
    this.internalLinks = new Map();
    this.externalLinks = new Map();
    this.incomingLinks = new Set();
  }
}

async function analyzePage(url, domain) {
  try {
    const response = await axios.get(url, { 
      timeout: 5000,
      headers: {
        'User-Agent': 'Mozilla/5.0 (compatible; CustomBot/1.0)',
      }
    });

    const $ = cheerio.load(response.data);
    const pageAnalysis = new PageAnalysis(url);

    $('a[href]').each((_, element) => {
      let href = $(element).attr('href');
      const anchorText = $(element).text().trim();

      if (!href) return;

      try {
        if (href.startsWith('/')) {
          href = new URL(href, domain).href;
        }

        // Normalize URLs
        href = new URL(href).href;

        if (href.startsWith(domain)) {
          pageAnalysis.internalLinks.set(href, anchorText);
        } else {
          pageAnalysis.externalLinks.set(href, anchorText);
        }
      } catch (e) {
        // Skip invalid URLs
      }
    });

    return pageAnalysis;
  } catch (error) {
    console.error(`Error analyzing ${url}: ${error.message}`);
    return null;
  }
}

async function processBatch(urls, domain, pageAnalyses) {
  const batchPromises = urls.map(url => analyzePage(url, domain));
  const results = await Promise.allSettled(batchPromises);

  results.forEach((result, index) => {
    if (result.status === 'fulfilled' && result.value) {
      pageAnalyses.set(urls[index], result.value);
    }
  });

  return urls.filter((url, index) => 
    results[index].status === 'fulfilled' && results[index].value
  );
}

async function analyzeDomain(domain, batchSize = 5) {
  const visited = new Set();
  const toVisit = new Set([domain]);
  const pageAnalyses = new Map();

  while (toVisit.size > 0) {
    // Take next batch of URLs
    const currentBatch = Array.from(toVisit).slice(0, batchSize);
    currentBatch.forEach(url => toVisit.delete(url));

    // Process the batch
    const successfulUrls = await processBatch(currentBatch, domain, pageAnalyses);

    // Mark as visited
    successfulUrls.forEach(url => visited.add(url));

    // Add new URLs to visit
    successfulUrls.forEach(url => {
      const analysis = pageAnalyses.get(url);
      if (!analysis) return;

      analysis.internalLinks.forEach((_, href) => {
        if (!visited.has(href) && !toVisit.has(href)) {
          toVisit.add(href);
        }

        // Update incoming links
        if (!pageAnalyses.has(href)) {
          pageAnalyses.set(href, new PageAnalysis(href));
        }
        pageAnalyses.get(href).incomingLinks.add(url);
      });
    });
  }

  return pageAnalyses;
}

function generateAnalysisReport(pageAnalyses) {
  const report = [];

  for (const [url, analysis] of pageAnalyses) {
    report.push({
      url,
      internalLinks: Array.from(analysis.internalLinks, ([url, anchor]) => ({
        url,
        anchorText: anchor
      })),
      externalLinks: Array.from(analysis.externalLinks, ([url, anchor]) => ({
        url,
        anchorText: anchor
      })),
      incomingLinks: Array.from(analysis.incomingLinks)
    });
  }

  return report;
}

function generateChartData(pageAnalyses) {
  const nodes = [];
  const links = [];
  const nodeMap = new Map();

  let nodeId = 0;
  for (const url of pageAnalyses.keys()) {
    nodes.push({
      id: nodeId,
      label: new URL(url).pathname || '/',
      url: url
    });
    nodeMap.set(url, nodeId);
    nodeId++;
  }

  for (const [url, analysis] of pageAnalyses) {
    const sourceId = nodeMap.get(url);

    for (const targetUrl of analysis.internalLinks.keys()) {
      const targetId = nodeMap.get(targetUrl);
      if (targetId !== undefined) {
        links.push({
          source: sourceId,
          target: targetId
        });
      }
    }
  }

  return { nodes, links };
}

